(function () {
  var header = document.querySelector('.header');
  var pageMenu = document.querySelector('.page-menu');

  if (header && pageMenu) {
    var nextElement;
    var startFixPosition;
    var menuHeight;
    var menuItems = pageMenu.querySelectorAll('.page-menu__item');
    var sections = [];
    var sectionPositions = [];
    var activeItem;
    var selectedItem;
    var lastTimeout;

    var getPadding = function () {
      var padding = header.offsetHeight;

      return padding + 24;
    };

    var setPositions = function () {
      nextElement = document.querySelector('.js-start-scroll');
      startFixPosition = window.getScrollTop() + pageMenu.getBoundingClientRect().top - header.offsetHeight;

      if (document.querySelector('.about')) {
        if (window.matchMedia('(min-width: 900px)').matches) {
          nextElement = document.querySelector('.js-start-fix');
        }
      }

      menuHeight = pageMenu.offsetHeight;

      for (var i = 0; i < menuItems.length; i += 1) {
        sections[i] = document.querySelector(menuItems[i].hash);
        sectionPositions[i] = window.getScrollTop() + sections[i].getBoundingClientRect().top - getPadding() - header.offsetHeight;
      }
    };

    var fixPageMenu = function () {
      if (!pageMenu.classList.contains('page-menu--fixed')) {
        nextElement.style.marginTop = menuHeight + 'px';
        pageMenu.classList.add('page-menu--fixed');

        for (var i = 0; i < menuItems.length; i += 1) {
          menuItems[i].parentElement.classList.remove('wow');
        }
      }
    };

    var unfixPageMenu = function () {
      pageMenu.classList.remove('page-menu--fixed');
      nextElement.style.marginTop = '';
    };

    var resetActiveItem = function (newItem) {
      if (activeItem) {
        activeItem.classList.remove('page-menu__item--active');
        activeItem.blur();
      }

      activeItem = newItem;

      if (activeItem) {
        activeItem.classList.add('page-menu__item--active');
      }
    };

    var updateMenu = function () {
      if (window.getScrollTop() > startFixPosition) {
        fixPageMenu();
      } else {
        unfixPageMenu();
      }

      var currentPosition = window.getScrollTop();

      if (selectedItem) {
        resetActiveItem(selectedItem);
      } else {
        resetActiveItem(null);

        for (var i = 0; i < sectionPositions.length; i += 1) {
          if (currentPosition >= sectionPositions[i]) {
            if (!sectionPositions[i + 1] || currentPosition < sectionPositions[i + 1]) {
              resetActiveItem(menuItems[i]);
            }
          }
        }
      }
    };

    window.addEventListener('resize', function () {
      unfixPageMenu();
      setPositions();
      updateMenu();
    });

    window.setInterval(function () {
      updateMenu();
    }, 100);

    document.addEventListener('click', function (evt) {
      if (evt.target.classList.contains('page-menu__item')) {
        selectedItem = evt.target;
        var activeSection = document.querySelector(evt.target.hash);
        activeSection.style.paddingTop = getPadding() + 'px';
        activeSection.previousElementSibling.style.marginBottom = '-' + getPadding() + 'px';

        activeSection.scrollIntoView({
          block: 'start',
          behavior: 'smooth'
        });

        if (lastTimeout) {
          clearTimeout(lastTimeout);
        }

        lastTimeout = window.setTimeout(function () {
          selectedItem = null;
        }, 2000);

        evt.preventDefault();
      }
    }, true);

    setPositions();
    updateMenu();
  }
})();

